class Solution(object):
    def numDistinct(self, s, t):
        """
        :type s: str
        :type t: str
        :rtype: int
        """

        if len(s) < len(t):
            return 0

        dp = [0] * (len(t) + 1)
        dp[0] = 1

        for i in range(1, len(s) + 1):
            for j in range(min(i, len(t)), 0, -1):
                if s[i - 1] == t[j - 1]:
                    dp[j] += dp[j - 1]

        return dp[-1]

