        :type edges: List[List[int]]
        :rtype: List[int]
        """

        # find the node with two parents
        parent = {}
        child = {}
        for u, v in edges:
            if u in parent:
                if v in child:
                    return [parent[u], v]
                else:
                    child[u] = v
            else:
                parent[u] = v

        # find the node with only one parent
        if len(parent) == len(edges):
            return [parent[edges[-1][0]], edges[-1][1]]

